import React, {Component} from 'react'

class Bottom extends Component{
    render(){
        return(
            <div className="main-footer">
                <footer className="bottomContainer">
                    <ul>
                        <li>Support | </li>
                        <li>Policys | </li>
                        <li>Cookies | </li>
                        <li><img src="/test-static/stripe.png"/></li>
                    </ul>
                </footer>
            </div>
        )
    }
}

const ulStyling = {
    display: "inline"
}


export default Bottom;
